import { Header, Icon, Button } from "semantic-ui-react";

export const NewNadeImagePlaceholder = () => {
  return (
    <>
      <Header icon>
        <Icon name="video" />
        Gfycat Video
      </Header>

      <Button primary>Add</Button>
    </>
  );
};
